//differnet between timesf
function getDiff(firstTime, secondTime){
	if(firstTime != undefined && secondTime != undefined) {
        var hour1 = firstTime.substring(0, firstTime.indexOf(":"));
        var hour2 = secondTime.substring(0, secondTime.indexOf(":"));
        var min1 = firstTime.substring(firstTime.indexOf(":")+1);
        var min2 = secondTime.substring(secondTime.indexOf(":")+1);
        var time1 = (hour1*60) + (min1*1);
        var time2 = (hour2*60) + (min2*1);
        var time = time2 -  time1 ;
        var hour = time / 60;
        return(hour);
    }
   return '';
}
//removeElement from array function
function removeElement(array, elem) {
    var index = array.indexOf(elem);
    if (index > -1) {
        array.splice(index, 1);
    }
}

